    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een portus(stad) is een handelsnederzetting. Deze ontwikkelde zich in bepaalde gevallen uit nederzettingen in de nabijheid van castra tijdens de Romeinse periode. Vanaf de 9de eeuw werd een dergelijke grote nederzetting een portus genoemd. Het waren plaatsen waar levensmiddelen en andere goederen werden aangevoerd, opgeslagen en verhandeld. Deze portussteden fungeerden eerst als transitcentrum, later kwam er ook een eigen nijverheid tot stand.',
