    ),
    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een landelijk heilidom is een formele, ev. niet-overdekte locatie van niet-christelijke religieuze handelingen. Het waren min of meer vierkante terreinen die waren omgeven door een aarden wal en soms ook een greppel. Er was een toegang tot het binnenterrein waar vaak een klein gebouwtje in een hoek stond. Meestal hoorde een oude boom tot het religieuze complex. Dergelijke heiligdommen komen vooral voor tijdens de late bronstijd en de Vroeg-Romeinse Tijd.',
        'lang' => 'nl-BE',
      ),
    ),
