    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een mithraeum is een heiligdom voor de volgelingen van de mysteriegodsdienst van het mithraïsme. Een mithraeum was vaak gelokaliseerd in een natuurlijke grot of in een ruimte die een grot imiteerde. Dergelijke heiligdommen zijn te herkennen aan de banken die langsheen de muren lopen en het kenmerkend symbolisme van Mithras die een stier doodt.',
