    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een inheems-Romeinse tempel is een tempel in onze streken uit de Romeinse periode. Met de komst van de Romeinen in de Lage Landen werden ook de landelijke heiligdommen geleidelijk geromaniseerd. Daarbij bleef de min of meer vierkante vorm gehandhaafd, maar werd het cultusterrein zelf vervangen door de Gallo-Romeinse tempel, met in het midden een hoge cella die geheel werd omgeven door een zuilengalerij.',
