    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een Viereckschanze is een rechthoekige wal- en grachtenclosure die dateert uit de ijzertijd. Ze komen voor in Frankrijk, zuid-Duitsland, België en Bohemië. Ze werden vroeger geïnterpreteerd als cultusplaatsen, maar recent wordt een seculiere functie niet uitgesloten. Kenmerkend zijn (rituele?) schachten/kuilen die voorkomen in de hoeken van structuren en vierkante paalconstructies die kunnen geïnterpreteerd worden als kleine tempeltjes of opslagplaatsen.',
