    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een erf is het gebied direct om een huis of (met name) een boerderij. Ook de opstal zelf hoort bij het erf. De naam verwijst naar erfgoed, dat wat men kan erven. De term "zwervende erven" wordt gebruikt voor boerderijen die rondzwerven in een lokaal landschap waarbij de boerderij telkens weer opschoof naargelang de landbouwgrond uitgeput geraakte. Een zwervend erf omvat steeds een hoofdgebouw met enkele spijkertjes en bijgebouwen. Ze komen voor tijdens de bronstijd en de vroege - en middenijzertijd.',
        'lang' => 'nl-BE',
      ),
    ),
  ),
