    'http://www.w3.org/2004/02/skos/core#prefLabel' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'woonstalhuizen (archeologisch erfgoed)',
        'lang' => 'nl-BE',
      ),
    ),
    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een woonstalhuis bestaat uit een houten geraamte dat in de bodem gefundeerd was en waarvan de zware middenpalen het dakgebinte droegen en de minder zware wandpalen deel uitmaakten van een wandstructuur uit vlechtwerk en leem. Het dak was bedekt met stro of riet. In een woonstalhuis vonden zowel dieren als mensen gezamenlijk onderdak, de dieren in een stalgedeelte - al dan niet onderverdeeld met tussenschotten/boxen - de mensen in een woongedeelte waarin zich ook een haard bevond. Stal- en woongedeelte waren duidelijk van elkaar gescheiden. Vaak vormden de ingangspartijen in de lange zijden van het gebouw de scheiding tussen beide delen. Ze komen voor vanaf het laatneolithicum.',
        'lang' => 'nl-BE',
      ),
    ),
  ),
