        'value' => 'Een murus gallicus is een verdedigingsmuur uit de late ijzertijd, die over het algemeen is gemaakt van dikke lagen steen die bijeen worden gehouden en versterkt door een kern van houten geraamtes, aan elkaar gezet met ijzeren spijkers en voorzien van een aarden helling aan de binnenzijde. Aan de voorzijde werd een beschermlaag van stenen aangebracht.',
