    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een castrum is een permanent Romeins militair kampement opgezet volgens een rastervormig patroon; tijdens de middeleeuwen ook een aanduiding voor kastelen, forten of versterkte torens. De interne indeling van Romeinse castra is gestandaardiseerd. Vanaf de 4 poorten van het kamp liepen twee wegen, de via principalis en de via praetoria die loodrecht in het centrum van het fort sneden. Kleinere wegen verdeelden het fort verder in regelmatige blokken. Centraal binnen het fort lag de principia, het hoofdkwartier.',
        'lang' => 'nl-BE',
      ),
    ),
