    ),
    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'De Vaubanvesting is een type versterking opgericht in de periode tussen 1667 en 1707 en werd genoemd naar Sébastien Le Prestre de Vauban, een maarschalk onder Lodewijk XIV. Ze werden opgericht langsheen de westelijke, noordelijke en oostelijke Franse grens als verdedigingslinie. Deze vestingsteden worden gekenmerkt door uitgebreide verdedigingswerken met het gebruik van bastions, lunetten, gracht -en walsystemen en vertonen een stervorm. Vauban introduceerde het principe om de verdediging van een regio in verschillende linies uit te bouwen om zo de aanvaller tot een verspreide slagorde te dwingen. Hij werkte in totaal aan de bouw van 160 vestingen.',
        'lang' => 'nl-BE',
      ),
    ),
