    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een beerput is een ondergrondse constructie in de vorm van een kelder of put bedoeld voor de opvang van uitwerpselen met vaak een secundaire functie als afval- en vergaarbak. Deze putten zijn vaak gelegen onder een toilethokje achter een woonhuis. Tonputten (meerdere op elkaar geplaatste tonnen) en vierkante beerputten komen het meeste voor. Beerputten kunnen uitgevoerd zijn in hout of in (bak)steenbouw. Soms is er aanwijzing voor een (houten) vloer op de bodem van de beerput waarin een opening zou gelaten zijn om het afvloeien van vocht toe te laten, terwijl de vastere massa achterbleef. Het beer zelf werd vaak gebruikt als meststof.',
        'lang' => 'nl-BE',
      ),
    ),
  ),
