      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een latrine is oorspronkelijk een openbaar toilet waarin meerdere zitplaatsen voorzien zijn. Deze staan vaak in verbinding met een ander openbaar gebouw zoals een badhuis of ze komen voor in militaire context. Ze kunnen uitgevoerd zijn in hout of in steen. De lozing van een latrine gebeurde in een beerput, beerkuil of via een stortkoker naar buiten (eventueel naar een gracht).',
