    ),
    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een antropomorf graf is een graf dat de menselijke omtrek sterk benadert. Het graf is het breedst aan de schouders en smaller naar het voeteinde toe. Voor het hoofd werd vaak een nis uitgespaard, waarvan de bodem soms enkele centimeters hoger ligt. De constructiematerialen en afwerking kunnen sterk verschillen. Sommige graven werden opgebouwd uit gestapelde stenen bijeengehouden door kalkmortel (mogelijk ook nog glad afgewerkt met een kalkmortellaagje), andere graven kenden geen stenen opbouw, maar wel een kalkmortellaagje. Op dit graf kwam een deksel van hout of stenen platen, waarna de kuil tot het loopniveau weer met grond gevuld werd. Het hoogtepunt van het voorkomen van dergelijke graven kan geplaatst worden in de 10de-11de eeuw.',
        'lang' => 'nl-BE',
      ),
    ),
  ),
