    'http://www.w3.org/2004/02/skos/core#prefLabel' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'rijengrafvelden',
        'lang' => 'nl-BE',
      ),
    ),
    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een rijengrafveld is een begraafplaats uit de vroege middeleeuwen, waarbij de begravingen in min of meer in keurig geordende rijen zijn gegroepeerd. Omstreeks 400 kwam, na een lange traditie van crematie, lijkbegraving opnieuw op. Deze graven werden niet als voorheen onder een grafheuvel geplaatst (met de uitzondering van enkele elitegraven), maar in individuele kuilen naast elkaar. Men kan een etnisch onderscheid maken in de oriëntatie van de graven (Germaans: noord-zuid; Merovingisch: oost-west) en een afname van de grafgiften. Met de verbreiding van het christendom en de eerste kerken werden de graven naar de kerk verplaatst. De meeste rijengrafvelden houden rond deze periode (ca. 900) dan ook op te functioneren. Ze komen vooral voor langs rivieren in België, Nederland, Duitsland en Frankrijk.',
        'lang' => 'nl-BE',
      ),
    ),
  ),
