        'type' => 'literal',
        'value' => 'Een langbed is een soort grafheuvel met een rechthoekige, ovale tot trapezoïdale vorm (mogelijk afgeleid van de gelijktijdige huisvorm) waaronder een stenen (cist) of houten grafkamer is aangelegd. Het aantal graven in een dergelijke heuvel is in de vroegste gebruiksperiode beperkt (nog geen collectieve bijzettingen) en het aantal grafgiften is gering. Langbedden kunnen omgeven worden door een houten pallissade en/of een greppel.',
