        'type' => 'literal',
        'value' => 'Locatie waar vuursteen is gewonnen door middel van dag- of mijnbouw. De diepte van individuele extractieputten kan variëren van enkele decimeters tot meer dan 10 m. Oppervlaktewinning (simpelweg het verzamelen van dagzomend of ondiep in bodem aanwezig materiaal) laat zich moeilijk en hoogstens indirect, aan de hand van het debitagemateriaal, herkennen. Afhankelijk van de regio en het matrixsediment kan vuursteen gewonnen worden uit een primaire (kalksteen), secundaire (eluvium) of een tertiaire (grind, keileem) geologische context.',
