    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een Romeinse villa is een van stedelijk comfort voorziene woning op het platteland. Het is een landbouwbedrijf dat geïntegreerd is in de sociale en economische organisatie van de Romeinse wereld en waarvan het hoofdgebouw in Romeinse stijl is gebouwd. Dergelijke villa\'s bestaan uit een woongedeelte (pars urbana) en een bedrijfsgedeelte (pars rustica). De grootste villae rusticae hebben een hoofdgebouw (pars urbana) met links en rechts daarvan twee vleugels met de bedrijfsgebouwen (pars rustica).',
        'lang' => 'nl-BE',
      ),
    ),
