    ),
    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een hutkom is een gedeeltelijk ingegraven, rechthoekige houten constructie die gewoonlijk ongeveer 3 op 2 meter groot was. In de korte wanden stonden meestal palen die waarschijnlijk een zadeldak hebben gedragen. De wanden waren opgebouwd uit zoden, planken of vlechtwerk. Hutkommen hadden waarschijnlijk geen residentiële functie, maar werden eerder gebruikt als opslagplaats voor goederen of als plaats voor het uitoefenen van ambachten zoals textielbewerking (spinnen en weven) en het bewerken van hout, metaal of bot. Hutkommen zijn een vroegmiddeleeuws fenomeen, hoewel ze ook nog kunnen voorkomen tijdens de volle middeleeuwen.',
        'lang' => 'nl-BE',
      ),
    ),
  ),
