    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een meiler is een structuur bedoeld voor het vervaardigen van houtskool die wordt opgebouwd uit hakhout, gestapeld langs een centrale, met hout opgebouwde schoorsteen. Om het hout af te sluiten van de buitenlucht, werd het bedekt met aarde en zoden. In de schoorsteen werd reeds brandende houtskool gegoten om de oven te ontsteken. Men kan ook meilers onderscheiden waarvan de brandplaats als een grote kuil was ingegraven waarin het hout werd gedeponeerd om vervolgens te laten verkolen.',
        'lang' => 'nl-BE',
      ),
