    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een aacht is een ondergrondse schuilplaats uitgegraven in de leembodem (soms ook mergel) die gebruikt werd als toevluchtsoord tijdens de Tachtigjarige oorlog (1568-1648).  Ze stonden bijna altijd in verbinding met nabijgelegen hoeven, vierkantshoeven en soms ook kerken. Sommige aachten werden ook nog na de 17de eeuw gebruikt. Het fenomeen is vooral bekend in Belgisch en Nederlands Limburg.',
