    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een knotboom is een boom waarvan de stam op een bepaalde hoogte wordt afgezet en die hierop opnieuw uitloopt. Door periodiek afzetten van de takken ontstaat een knot. Het knotten van de knotboom wordt uitgevoerd in kapcyclussen. De hoogte van de knot wordt bepaald tijdens de eerste knotbeurt. De minimale knothoogte van een knotboom wordt hier bepaald op 1 meter. Indien de knothoogte lager is dan spreken we van hakhout.',
