      array (
        'type' => 'literal',
        'value' => 'Een struik is een vanaf de grond vertakte houtige plant, waarvan de vorm overeenkomt met zijn natuurlijke, soortgebonden habitus.   Struiken kunnen een hoge, lage, brede of smalle groeivorm hebben. De struik kan zich op volstrekt natuurlijke wijze uitgezaaid hebben en de groeivorm kan bepaald zijn door de natuurlijke groeiomstandigheden (bv. natuurlijke snoei). Indien de struik in een kwekerij is opgegroeid, dan is de groeivorm bepaald door de jeugdsnoei en is het eindbeeld van de struik bepaald door de begeleidingssnoei die wordt uitgevoerd vanaf het planten. ',
