    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een pastorietuin is een tuin bij een pastorie, vaak omgracht, ommuurd of omhaagd. In de 18de eeuw zijn deze tuinen volgens het “vivre entre cour et jardin” model ingericht met een bij het huis aansluitende strakke, vierkante tuin voor groenten, fruit en bloemen, meestal met een padenkruis en achteraan een zogenaamd “pastoorsbosje” met hakhout. In de 19de eeuw worden verschillende “bosjes” omgevormd tot miniatuurversies van de kasteelparken in landschappelijke stijl met een slingerpad, enkele bruine beuken,  een taxusbosje en eventueel een vijvertje met eilandje. Het hakhout wordt daarbij vervangen door typische parkheesters.',
        'lang' => 'nl-BE',
      ),
    ),
  ),
