        'value' => 'Een moeraskalkafzetting is een afzetting in alluviale gebieden, die geleidelijk en onder invloed van grondwaterstroming ontstaat door neerslag van afgestorven kalkalgen en mollusken (slakken, tweekleppigen) in stilstaand water. De moeraskalk die door de kalkalgen en mollusken werd opgenomen is afkomstig van kalkrijke kwel. In verdroogde toestand bestaat de neerslag uit verkitte, soms verbrokkelde witgrijze tot leverkleurige banken.',
