        'type' => 'literal',
        'value' => 'Een veteraanboom is een natuurlijk of kunstmatige gevormde boom of uitzonderlijk een struik die zich omwille van de individuele ouderdom in een langzame aftakelingsfase bevindt. Veteraanbomen worden vaak gekenmerkt door een opvallende groei, of door een voor de betreffende soort grote stamomtrek, of door de aanwezigheid van holtes in de stam of in de takken, of door dood hout in de kruin, of door een epifytenbegroeiing op de stam, of door spleten of loslatende delen in de schors, of door sapuitvloei, slijmvloed, luchtwortel- of schimmelgroei ter hoogte van beschadigingen. ',
