        'type' => 'literal',
        'value' => 'boerenschansen',
        'lang' => 'nl-BE',
      ),
    ),
    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een boerenschans is een met wallen en grachten omheinde ruimte die door de plattelandsbevolking in de Antwerpse, Limburgse en Brabantse Kempen op eigen initiatief werd opgetrokken om zich te beschermen tegen plunderende bendes en legereenheden. Ze zijn vrijwel zonder uitzondering opgeworpen tijdens de Tachtigjarige Oorlog (1568-1648). In tegenstelling tot militaire schansen konden deze vluchtschansen geen beleg door een leger doorstaan. Ze werden aangelegd op gemeenschapsgrond, vooral in natte en moeilijk toegankelijke gebieden. De verdediging bestond uit de afgelegen en geïsoleerde ligging. Indien de schans toch werd ontdekt dan bood ze voor de boerengemeenschap toch nog een betere positie tot onderhandelen en het kopen van een vrijstelling van roof en plundering (ook wel saufgarde genoemd).',
        'lang' => 'nl-BE',
      ),
    ),
