    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een bolderskot of bolderbaan is een langgestrekte, soms komvormige speelbaan (verhouding ca. 11 X 3m), al dan niet overdekt en gebruikelijk op aarden ondergrond, waarin met houten afgeplatte en afgeronde schijven of bollen naar een vast doel of ‘stek’ (vaak houten staakje) wordt gerold. De baan wordt in twee speelrichtingen gebruikt (2 houten stekken op ca. 7m afstand van elkaar) en is doorgaans voorzien van een afscherming op de korte zijden om te beletten dat de bollen uit de baan gespeeld worden.',
