    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een ustrina is een - meestal herbruikbare - centrale brandstapel waarop de verbranding van doden plaatsvond. De meeste doden werden op gemeenschappelijke brandstapels gecremeerd. Ze onderscheiden zich van de busta door hun afmetingen. In onze streken had het ustrina veeleer een tijdelijk karakter; na verscheidene keren gebruikt te zijn geweest, werd de plek verlaten ten voordele van een nieuwe locatie. Sporen van ustrinae komen niet vaak voor in Vlaanderen omdat deze constructies zich doorgaans aan het oppervlak bevonden en hun restanten door de latere landbewerking meestal helemaal verdwenen zijn. Enkel wanneer eerst een ondiepe kuil werd gegraven treft men er sporen van aan.',
        'lang' => 'nl-BE',
      ),
