        'type' => 'literal',
        'value' => 'Een bustumgraf is een graf waarbij de brandstapel ter plaatse boven de open grafkuil opgericht wordt. Tijdens het branden stortte de stapel in de kuil; de grafkuil wordt dan ook steeds gekenmerkt door geblakerde wanden want het vuur bleef zeker nog een tijd branden en nasmeulen. Pas wanneer het geheel voldoende was afgekoeld kon het gecremeerd bot ingezameld worden of eventuele grafgiften in de kuil worden geplaatst. Busta zijn vrij zeldzaam in onze gewesten.',
