        'type' => 'literal',
        'value' => 'Een dries is een gemene grond in gebruik als een gemeenschappelijke verzamel- en overnachtingsplaats voor het vee in een dorpskern en wordt gekenmerkt door de aanwezigheid van een poel. Ook bomen en hagen voor algemeen gebruik werden hier aangeplant. Later evolueerden driesen vaak tot dorpspleinen. De term is ontstaan uit de weidefunctie van het drieslagstelsel en leeft soms nog in die hoedanigheid als weide verder.',
