    'http://www.w3.org/2004/02/skos/core#note' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Gebruik \'inheemse nederzettingen\' voor dergelijke structuren die tot de Romeinse periode behoren. Let wel: het is vaak moeilijk een onderscheid te maken tussen wat ijzertijd is en wat Romeins bij inheemse structuren op het raakvlak van deze periodes.',
