    'http://www.w3.org/2004/02/skos/core#related' => 
    array (
      0 => 
      array (
        'type' => 'uri',
        'value' => 'https://id.erfgoed.net/thesauri/erfgoedtypes/1068',
      ),
    ),
    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Ferme indigène is een term ingevoerd vanuit de luchtfotografie om geïsoleerde nederzettingen en boerderijen in het landschap aan te duiden. Archeologisch gaat het om omgrachte erven van bewoningen met een gecompartimenteerde structuur, waarin één hoofdgebouw en enkele bijgebouwen ingeplant zijn die tot één agrarische eenheid behoren. Ze komen vooral voor tijdens de late ijzertijd. Men moet dergelijke structuren ook bekijken in het kader van het latere romanisatieproces waarbij deze - letterlijk vertaald - inheemse boerderijen als tegenhangers en tegelijkertijd voorgangers kunnen gezien worden van de opkomende Romeinse villae.',
        'lang' => 'nl-BE',
      ),
    ),
  ),
