    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een vrijheidsboom is een boom die staat voor vrijheid en democratie. De vrijheidsboom was een veelgebruikt symbool van de vernieuwde maatschappij die bewerkstelligd werd na het einde van het Ancien Régime aansluitend op de Franse Revolutie. De aanhangers van de Franse Revolutie inspireerden zich op een gelijkaardig gebruik gedurende de aanloop naar de Amerikaanse Revolutie (Boston Liberty Tree). Er werden ook vrijheidsbomen geplant na de Belgische Revolutie in 1830 om de onafhankelijkheid van België te vieren.',
        'lang' => 'nl-BE',
      ),
    ),
  ),
