        'value' => 'Een stuw is een waterbouwkundige constructie om de waterstand of het verval van kunstmatige waterlopen/waterwegen te reguleren of te controleren, zowel ter voorkoming of beperking van wateroverlast elders als bij watersnood. Stuwen komen vooral voor op niet-bevaarbare waterlopen en kunnen ervoor zorgen dat de waterstand voor of achter de stuw zoveel als mogelijk op een gewenst peil wordt gebracht. Bij een overschot aan water kan het afsluitsysteem/mechanisme geheel of gedeeltelijk worden afgesteld.',
