    'http://www.w3.org/2004/02/skos/core#historyNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => '26/01/2011: SN beetje aangepast. Oorspronkelijk: "Versterkte torens, oorspronkelijk bedoeld als bewaarplaats van de geschreven stedelijke voorrechten en vergaderplaats van de stadsraad, vaak met een wapenarsenaal. De versterking deed ook dienst als uitkijktoren met alarmklok. Als monumentale uitdrukkingen van de gemeentelijke vrijheden bezitten de belforten een diepgewortelde symbolische betekenis. Er werden nog belforten opgetrokken tot aan WO II."',
