    'http://www.w3.org/2004/02/skos/core#prefLabel' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'belforten',
        'lang' => 'nl-BE',
      ),
    ),
    'http://www.w3.org/2004/02/skos/core#related' => 
    array (
      0 => 
      array (
        'type' => 'uri',
        'value' => 'https://id.erfgoed.net/thesauri/erfgoedtypes/260',
      ),
    ),
    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een belfort is een versterkte toren, die soms afzonderlijk staat of vaak verbonden is met een stadhuis of stedelijke markthal (lakenhal). Het belfort bood een veilige plaats voor het bewaren van charters, de stadsgelden en andere waardevolle bezittingen van de stad (hiervoor waren in de fundering kelders voorzien) en werd gebruikt voor het hangen van de stadsklok. De versterking deed ook dienst als uitkijktoren met alarmklok. Het belfort was lange tijd het enige officiële gebouw van de stad en werd dan ook gebruikt als vergaderzaal van de schepenen. Als monumentale uitdrukkingen van de gemeentelijke vrijheden bezitten de belforten een diepgewortelde symbolische betekenis. Er werden nog belforten opgetrokken tot aan WO II.',
        'lang' => 'nl-BE',
      ),
    ),
  ),
