        'value' => 'Een gasthuis is oorspronkelijk een huis dat ter opvang en verpleging van gasten is ingericht. In deze betekenis is het reeds in de 17de eeuw verouderd, en geëvolueerd naar twee types, nl.: het Godshuis (\'hôtel-Dieu\', dat evolueert naar \'hospice\') waar het accent ligt op het opvangen van ouden van dagen, wezen &amp; weduwen, en het hospitaal (\'hôpital\') waar het accent ligt op de ziekenverzorging en dat evolueert naar het ziekenhuis.',
