      ),
    ),
    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een site met walgracht  - moated site, omwalde of omgrachte hoeve - is een door een brede gracht omgeven wooncomplex, waarbij het voornaamste gebouw opgetrokken is uit (bak)steen. De rest bestaat uit steen- of meestal houtbouw. De gebouwen kunnen defensieve elementen, zoals torens en een poortgebouw, bezitten, maar zijn niet reëel verdedigbaar. Deze elementen vervullen voornamelijk een statusfunctie. De vorm van de woonzone kan vierkant, rechthoekig, cirkelvormig of onregelmatig zijn. In enkele gevallen werd de woonzone opgehoogd. Ze kunnen gedateerd worden tussen de late middeleeuwen en de nieuwe tijd. De sites zijn vaak nog te herkennen in het landschap door de aanwezigheid van een gracht rondom een hoevecomplex. Vaak is ook het wooneiland nog als ophoging herkenbaar. In de 18de eeuw werden ook pastorieën in landelijk gebied vaak als site met walgracht geconcipieerd.',
        'lang' => 'nl-BE',
      ),
    ),
  ),
