    'http://purl.org/dc/terms/bibliographicCitation' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => '1) Vangheluwe H. 1997-1998, Geografische aspecten van sites met walgracht in de omgeving van Ieper, scriptie voorgelegd tot het behalen van de graad van Licentiaat in de geografie, Universiteit Gent. 2) De Wit G. &amp; Sloos A. 2008, De interpretatie van archeologische waarnemingen in Archis. Een concept voor een nieuwe set complextypen, in: Rapportage Archeologische Monumentenzorg 165, Amersfoort. 3) <a href="https://onderzoeksbalans.onroerenderfgoed.be/onderzoeksbalans/archeologie/late_middeleeuwen_en_moderne_tijden/landelijke_archeologie/sites_met_walgracht">https://onderzoeksbalans.onroerenderfgoed.be/onderzoeksbalans/archeologie/late_middeleeuwen_en_moderne_tijden/landelijke_archeologie/sites_met_walgracht</a> (geraadpleegd op 13/08/2014) 4) Verhaeghe F. 1977: De middeleeuwse landelijke bewoningssites in een deel van Veurne-Ambacht. Een bijdrage tot de middeleeuwse archeologie, onuitgegeven doctoraatproefschrift.',
      ),
