        'value' => 'Een mottekasteel is een kasteel of versterking op een aarden ophoging (motteheuvel) als residentie van een lokale heer en wordt gekenmerkt door een opperhof, met doorgaans circulair grondplan, met bijbehorend neerhof. Het opperhof, als militaire verdedigende component, bestaat meestal uit een versterkte toren (uit hout, steen of vakwerk) op een motteheuvel, terwijl op het neerhof gebouwen met een eerder agrarisch, religieus of residentieel karakter konden staan. Het geheel werd omgeven door een palissade om de verdediging te vervolledigen. Mottekastelen komen voornamelijk voor tijdens de volle middeleeuwen als een gevolg van het feodaliteitsprincipe. Ze kennen een enorme bloei tijdens de 12de eeuw. De 13de en 14de eeuw betekenen het einde van het mottekasteel. De oorlogstechnieken zijn veranderd en de mottekastelen blijken niet efficiënt genoeg meer. Tijdens de late middeleeuwen krijgen ze dus eerder een prestigefunctie.',
        'lang' => 'nl-BE',
      ),
    ),
  ),
