    'http://www.w3.org/2004/02/skos/core#historyNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => '11/08/2017: SN aangepast op vraag van Peter Van den Hove. Oorspronkelijke SN: "Een schans is een doorgaans aarden verdedigingswerk, met wallen en grachten omheind dat door de mens is aangewend voor schuil- en verdedigingsdoeleinden. De term schans wordt vooral gebruikt voor kleinere verdedigingsstructuren die vanaf de Tachtigjarige Oorlog (1568-1648) voorkomen. Een schans is een versterking die vooral door de plattelandsbevolking op eigen initiatief werd opgetrokken om zich te beschermen tegen de vele bendes en legers die het land teisterden, maar men kan ook militaire schansen onderscheiden. De verdediging bestond vooral uit de geïsoleerde en weinig toegankelijke ligging, grachten en een wal."',
        'lang' => 'nl-BE',
      ),
      1 => 
