    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een depot is een om opzettelijke redenen (vanuit religieusrituele, functionele en sociale achtergronden) gedeponeerd object (of meerdere objecten) in hetzij droge context (hoge delen van duinen en donken, dekzandkoppen, ...), hetzij natte context (water, moeras, rivier, ...). Het kan gaan om een stuk grondstof, halffabricaten en/of eindproducten, maar ook om de depositie van menselijke resten die geen zichtbare grafstructuur hebben bv. veenlijken of menselijke deposities in een waterput.',
        'lang' => 'nl-BE',
      ),
