    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Een klooster is een gebouwcomplex voor mensen die religieuze geloften hebben afgelegd en in gemeenschappen van een religieus instituut leven. Kloosters vallen onder het gezag van een lokale bisschop, terwijl een abt of abdis aan het hoofd staat van een abdij. In een klooster kan men enkele standaardruimten afbakenen waaronder de kapittelzaal, het calefactorium (warme ruimte), de kloosterkerk, de slaapzaal, de refter, het sciptorium (waar documenten werden gekopieerd) enz...',
