    'http://www.w3.org/2004/02/skos/core#note' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Kapellen kunnen worden benoemd op basis van hun locatie (boskapel, veldkapel, ...), op basis van de heilige waaraan ze zijn gewijd (Mariakapel), op basis van het motief van hun oprichting (beschermkapel, dankkapel, ...) of op basis van hun vormgeving. In deze thesaurus is gekozen voor een indeling op basis van vorm.
Andere benamingen van kapellen zijn opgenomen als doorverwijsterm en zullen bij het zoeken doorverwijzen naar de algemene typologie "kapellen (klein erfgoed)".',
