    'http://www.w3.org/2004/02/skos/core#scopeNote' => 
    array (
      0 => 
      array (
        'type' => 'literal',
        'value' => 'Bescheiden gebouwtjes of constructies, opgericht door een geloofsgemeenschap of een privé-persoon uit devotie voor Christus, Maria of een heilige. Voornamelijk ter bescherming, om genezing af te smeken, of uit dank. Deze kapellen komen vaak voor langs de openbare weg, maar kunnen ook in een veld, bos, of op een privédomein of erf gelegen zijn.',
